import React from "react";

const Card = ({data}) => {
    console.log(data);

    return(

        <div className="cardContainer">

            {data.map((curItem,index)=> {
                return(

                    <div className="card">
                        <img></img>
                        <div className="cardContent">
                            <a>{curItem.title}</a>
                            <p>{curItem.description}</p>
                            <button onClick={()=>curItem.url}>Read More</button>
                        </div>
                    </div>
                )
                })}
        </div>
    )
}
export default Card
